text:
@AShenningsen Det som betyder noget er jo at f.eks. elbiler eller rene energikilder som atomkraft, sol, vind er - eller på et tidspunkt bliver - konkurrencedygtige - så alle i hele verden vælger dem af sig selv uden “opofrelse”. 

Alt andet er politisk manipulation og teater.

#dkpol #dkgreen

@AShenningsen Forstå mig ret; jeg mener også vi skal “gøre noget” - men ikke “gøre noget” som er dyrt men ubetydeligt. Vi skal have øje for proportionerne; DK udleder under 0,10% af global CO2. 

Kan vi udvikle teknologi som andre lande også af sig selv vil købe kan det rykke 

#dkpol #dkgreen

@AShenningsen Men vi (Danmark) kan ikke bremse "klima-udfordringen”. 

Men det kan blive ekstremt dyrt (også ikke pekuniært) (70%-målet står til at koste os måske 800 milliarder kroner - uden det vil kunne måles på klimaet) at lave en masse tiltag for at føle “vi gør noget”. 

#dkpol #dkgreen

@AShenningsen Medierne skriver ubønhørligt og helt uproportionelt meget om “klima”-udfordringen. De skriver nok også for meget om corona - men nuvel.

Danmark kan ikke påvirke klimaet målbart. Danmark udleder mindre end 0,10% af global CO2. Og mindre CO2 pr indbygger end Kina.

#dkpol #dkgreen https://t.co/N2Y7aR4WME

@AShenningsen Men det er jo to vidt forskellige problemstillinger? Corona er/var en krise - noget vi ikke vidste hvormange ville dø af og som vi forhåbentlig kunne gøre noget i forhold til.

“Klima” er ikke en krise, men en udfordring. Ikke noget Danmark kan gøre noget ved.

#dkpol #dkgreen

@pcgreenddalgi Men tallene du citerer er ikke korrekte og tallene i artiklen (fra en eller anden rapport som opfinder “CO2-aftryk” - ikke udledning - fra 2007!) er ikke sammelignelige.

Det er en grundløs selvovervurdering at Danmark skulle være “foregangsland”. For hvem?

#dkpol #dkgreen

